(1, 'Hotel Vio Pasteur', 70, 'Jl. Dr. Djunjunan (Pasteur) 154 Bandung', 'Terletak di pusat kota Bandung, Vio Hotel Pasteur hanya berjarak 10 menit berkendara dari Bandara Internasional Husein Sastranegara. Hotel ini memiliki sebuah restoran dan menawarkan kamar-kamar kontemporer dengan akses Wi-Fi gratis. Tempat parkir di hotel ini tersedia secara gratis.\r\n\r\nVio Hotel Pasteur berjarak 10 menit berkendara dari tempat-tempat perbelanjaan di Paris Van Java dan 15 menit berkendara dari Chiampelas Walk.\r\n\r\nMenampilkan dekorasi minimalis, kamar-kamar ber-AC dilengkapi brankas pribadi dan TV layar datar bersaluran kabel dan satelit. Kamar mandi pribadinya dilengkapi fasilitas shower air panas dan dingin serta perlengkapan mandi gratis. Tersedia juga sebuah lemari pakaian.\r\n\r\nRestoran Vio Hotel Pasteur menyajikan hidangan khas Indonesia, juga makanan ringan dan kopi. Tersedia layanan kamar.', 300000, 3, 150, 'WiFi Gratis, AC, Layanan Kamar,Shuttle Service, Breakfast, Laundry, ', );

