(1, 'Tebing Keraton', 78, 'Ciburial, Kec.Cimenyan, Kabupaten Bandung Barat, Jawa Barat 40198', 'Tebing Keraton Bandung tempat wisata cocok bagi pecinta alam yang dikelilingi perbukitan membuatnya jadi satu dari sekian kota yang spesial di Kota Bandung. \r\nBerada di ketinggian memungkinan pengunjung bisa melihat pemandangan matahari terbit dan tenggelam. Jika datang waktu pagi hari, semburat kuning sinar matahari, berpadu dengan hijaunya hutan dan kabut. Sedangkan saat sore hari, sinar keemasan matahari bisa menjadi latar belakang untuk berfoto.\r\nWaktu terbaik untuk datang saat pagi hari yaitu 05.00-07.00 WIB. Namun, untuk mendapatkan foto yang lebih bagus dan meminimalisir noise, bisa datang saahari biasa. Hal tersebut disebabkan akan lebih banyak pengunjung yang datang saat akhir pekan.', 3, '05:00:00', '18:00:00', 15000, );

